import Layout from "../layout";

function Checkout() {
  return (
    <Layout>
      <div className="w-2/4 m-auto pt-10">
        {["Delivery", "Shipping", "Billing", "Payment"].map((item) => (
          <div>
            <hr className="h-px my-4 bg-gray-200" />
            <h3 className="text-xl font-medium text-gray-800 mb-4">{item}</h3>
          </div>
        ))}
      </div>
    </Layout>
  );
}

export default Checkout;
